import React from 'react';

function Contact() {
  return (
    <div className="section" id="contact">
      <div className="contact-buttons">
        <a href="mailto:antoine.levy27@gmail.com" className="contact-btn email-btn">
          <i className="fas fa-envelope"></i> Email
        </a>
        <a href="https://www.linkedin.com/in/antoine-l%C3%A9vy-653106201/" target="_blank" rel="noopener noreferrer" className="contact-btn linkedin-btn">
          <i className="fab fa-linkedin"></i> LinkedIn
        </a>
        <a href="https://x.com/AntoineLevy27" target="_blank" rel="noopener noreferrer" className="contact-btn twitter-btn">
          <i className="fab fa-twitter"></i> Twitter
        </a>
        <a href="https://github.com/AntoineLevyy" target="_blank" rel="noopener noreferrer" className="contact-btn github-btn">
          <i className="fab fa-github"></i> GitHub
        </a>
      </div>
    </div>
  );
}

export default Contact;
